import React from "react";
import "./App.css";
import axios from "axios";
import { useQuery } from "react-query";

const apiClient = axios.create({
  baseURL: "http://127.0.0.1:8080",
  headers: {
    "Content-type": "application/json",
  },
});

function App() {
  const { data, isLoading } = useQuery("getUser 654122117", async () => {
    const { data } = await apiClient.get(`/users/654122117`);
    console.log(data)
    return data;
  });

  return (
    <div className="App">
      {isLoading ? "loading..." : data}
      <h1>Hello</h1>
    </div>
  );
}

export default App;
